import React,{Component} from "react";
import { Nav } from 'react-bootstrap';


class Navbar extends Component {
  render(){
    return(
      <nav className="nav">
      <ul>
        <li>
          <Nav
            activeKey="/home"
            onSelect={(selectedKey) => alert(`selected ${selectedKey}`)}
          > </Nav>
        </li>
        <li>
          
        </li>
      </ul>
    </nav>
    );  
  }
}

export default Navbar
